t.add("welcome.organize_trips.desc_v2", "Vous voulez un seul endroit pour conserver tous vos projets de voyage? Nous avons ce qu\u2019il vous faut. AwardWallet peut r\u00e9cup\u00e9rer chaque composante de voyage pour tous vos voyages aupr\u00e8s des diff\u00e9rents services, y compris les services a\u00e9riens, h\u00f4teliers, de location de voitures et de restauration, les organiser et les rassembler en une chronologie facile \u00e0 utiliser. Vous pouvez importer vos voyages en les extrayant de vos comptes de fid\u00e9lit\u00e9: %link% ou les envoyer par courrier \u00e9lectronique sur votre messagerie personnalis\u00e9e AwardWallet: %email%.", "email", "fr");
