t.add("answer.1", "AwardWallet.com comporte 3 fonctionnalit\u00e9s principales: <ol class=\"counter-list\"> <li>AwardWallet est con\u00e7u pour vous aider \u00e0 faire le suivi des diff\u00e9rents comptes de fid\u00e9lit\u00e9, pour vous et votre famille. Pour cela, nous nous connectons aux diff\u00e9rents comptes de r\u00e9compense et en r\u00e9cup\u00e9rant votre solde en votre nom. Nous r\u00e9cup\u00e9rerons ou calculerons la date d'expiration, le niveau d'\u00e9lite, etc. et montrerons ces informations dans un seul rapport facile \u00e0 comprendre.<\/li> <li>AwardWallet vous aidera \u00e0 g\u00e9rer vos plans de voyage via notre fonction \u00ab<a href=\"\/trips\/\">Voyages<\/a>\u00bb sur la web et via nos App mobiles.<\/li> <li>AwardWallet vous aide \u00e0 \u00e9changer vos miles pour les tarifs internationaux de premi\u00e8re classe ou de classe affaires. Il vous suffit de <a href=\"\/awardBooking\/add\">soumettre une demande de r\u00e9servation<\/a> et notre \u00e9quipe fera de son mieux pour trouver le meilleur itin\u00e9raire pour vous.<\/li> <\/ol>", "faq", "fr");
t.add("answer.10", "<div class=\"secure-information\"> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-1\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Nous utilisons toujours des <span class=\"red\">technologies de cryptage normalis\u00e9es de l'industrie<\/span> lors du transfert et la r\u00e9ception des donn\u00e9es des clients \u00e9chang\u00e9es avec notre site. Nous disposons de mesures de s\u00e9curit\u00e9 appropri\u00e9es dans nos installations physiques, afin de nous prot\u00e9ger contre toute perte, mauvaise utilisation ou modification des informations collect\u00e9es aupr\u00e8s de vous.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-2\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Nous proposons et recommandons \u00e0 nos utilisateurs d'<a href=\"https:\/\/awardwallet.com\/user\/edit.php\">activer<\/a> <span class=\"red\">l'authentification \u00e0 deux facteurs<\/span> sur leurs comptes. De cette fa\u00e7on, m\u00eame si quelqu'un vole votre mot de passe AwardWallet ou se saisit de votre ordinateur, il leur faudra encore g\u00e9n\u00e9rer un code unique pour acc\u00e9der \u00e0 votre profil.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-3\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Toutes vos <span class=\"red\">donn\u00e9es sensibles sont crypt\u00e9es<\/span>dans notre base de donn\u00e9es s\u00e9curis\u00e9e. Chaque fois que nous transf\u00e9rons vos mots de passe, nous utilisons un protocole https s\u00e9curis\u00e9 (sans Heartbleed). Nous vous offrons \u00e9galement la possibilit\u00e9 de stocker vos mots de passe localement sur votre ordinateur dans un cookie. Cependant, il existe des avantages de stocker vos mots de passe dans notre base de donn\u00e9es, par exemple, nous pourrions v\u00e9rifier automatiquement vos soldes et vous envoyer un rapport avec vos changements de solde. Des milliers de personnes nous ont fait confiance avec leurs informations de compte, notre service est tr\u00e8s bien \u00e9tabli (nous avons lanc\u00e9 notre site en 2004) et le site Web est h\u00e9berg\u00e9 et fond\u00e9 aux \u00c9tats-Unis d'Am\u00e9rique.<\/p> <\/div> <\/div> <div class=\"row\"> <div class=\"thumb\"><i class=\"faq-icon-4\">&nbsp;<\/i><\/div> <div class=\"description\"> <p>Nous <span class=\"red\">participons \u00e0 une chasse aux erreurs \u00e0 r\u00e9compense<\/span> avec&nbsp;Cobalt&nbsp;<a href=\"https:\/\/cobalt.io\/awardwallet\">https:\/\/cobalt.io\/awardwallet<\/a> o\u00f9 nous payons des pirates informatiques pour trouver des probl\u00e8mes de s\u00e9curit\u00e9 avec notre service.<\/p> <\/div> <\/div> <\/div> &nbsp; <p><strong>Enfin, pour les techniciens, voici plus d'infos:<\/strong><\/p> <ul> <li>Vos mots de passe AwardWallet sont dot\u00e9s d'une empreinte bcrypt, co\u00fbt: 13, plus un sel unique pour chaque utilisateur.<\/li> <li>Pour les mots de passe que les utilisateurs stockent localement sur leurs ordinateurs, nous utilisons Rijndael (similaire \u00e0 AES), 256 bits.<\/li> <li>Le cookie \"M\u00e9moriser mes coordonn\u00e9es\" est une empreinte sha 256&nbsp;de certains attributs d'utilisateur<\/li> <li>Les mots de passe de compte de fid\u00e9lit\u00e9 sont crypt\u00e9s avec la cl\u00e9 1024 RSA.<\/li> <li>Si quelqu'un essaie de forcer brutalement votre compte, nous les verrouillerons pour une p\u00e9riode de temps apr\u00e8s plusieurs tentatives de connexion invalides.<\/li> <\/ul>", "faq", "fr");
t.add("answer.11", "Apr\u00e8s votre connexion, vous devez vous rendre \u00e0 \u00ab<a class=\"a14pxBlue\" href=\"\/account\/list.php\">Mon Programme de r\u00e9compenses<\/a>\u00bb. Sur cette page, vous pouvez naviguer jusqu'\u00e0 \u00ab<a class=\"a14pxBlue\" href=\"\/account\/add.php\">Ajouter un nouveau programme<\/a>\u00bb sur la gauche du menu de navigation. Choisissez un programme de r\u00e9compense dans la liste pour l'ajouter \u00e0 votre profil. Veuillez noter qu'avant d'ajouter un programme, vous devez conna\u00eetre votre nom d'utilisateur et votre mot de passe \u00e0 partir du site Web du programme de fid\u00e9lisation qui fournit votre solde. S'il vous est impossible de vous rendre sur le site web qui fournit le solde (ex: pour Marriott ce serait <a class=\"a14pxBlue\" href=\"http:\/\/www.marriott.com\">http:\/\/www.marriott.com<\/a>) AwardWallet ne pourrait pas r\u00e9cup\u00e9rer votre solde non plus. Une fois que vous avez ajout\u00e9 un programme de r\u00e9compense \u00e0 votre profil, il s'affichera dans la section \u00ab<a class=\"a14pxBlue\" href=\"\/account\/list.php\">SOLDES<\/a>\u00bb. Vous pouvez soit cliquer sur le bouton \"Mise \u00e0 jour\" pour r\u00e9cup\u00e9rer automatiquement le solde pour un seul programme, soit cliquer sur le bouton \u00abMettre tout \u00e0 jour\u00bb pour mettre \u00e0 jour automatiquement tous les programmes de r\u00e9compense sur votre profil. Veuillez noter que si vos informations de connexion sont correctes, vous pouvez \u00e9galement utiliser notre fonction de connexion automatique, permettant \u00e0 AwardWallet.com vous connecte automatiquement au site Web du fournisseur (c.-\u00e0-d. www.marriott.com). De cette fa\u00e7on, vous pouvez voir toutes les informations suppl\u00e9mentaires sur votre compte. La fonction de connexion automatique est disponible dans la plupart des programmes de r\u00e9compenses que nous prenons en charge. Pour plus de d\u00e9tails \u00e0 propos de la connexion automatique, veuillez voir ce conseil:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/28-auto-login\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/28-auto-login\/<\/a>", "faq", "fr");
t.add("answer.14", "Non. AwardWallet ne peut pas transf\u00e9rer des miles entre les diff\u00e9rents programmes, m\u00eame si le programme de r\u00e9compense vous permet de transf\u00e9rer vos miles \/ points, seul le titulaire du compte peut demander un tel transfert directement au fournisseur du programme de r\u00e9compense.", "faq", "fr");
t.add("answer.19", "Apr\u00e8s avoir ajout\u00e9 un programme de r\u00e9compense \u00e0 votre profil, vous pouvez suivre le lien \u00abmodifier\u00bb, o\u00f9 vous pourrez ajouter un bref commentaire au compte souhait\u00e9 (ex: compte de Maman).", "faq", "fr");
t.add("answer.2", "Non. AwardWallet n'est affili\u00e9 \u00e0 aucune compagnie a\u00e9rienne, h\u00f4tel ou tout autre programme de r\u00e9compense et n'a donc pas acc\u00e8s \u00e0&nbsp;cette information. Il vous incombe de conna\u00eetre les num\u00e9ros, identifiants, mots de passe, etc. li\u00e9s \u00e0 vos programmes de r\u00e9compenses.", "faq", "fr");
t.add("answer.20", "Non.", "faq", "fr");
t.add("answer.21", "<table border=\"0\" cellpadding=\"10\" cellspacing=\"0\" class=\"main-table upgraded-account\"> <thead> <tr> <td>&nbsp;<\/td> <td align=\"center\" style=\"font-size: 12px;white-space: nowrap;\">AwardWallet <span class=\"bold\">Gratuit<\/span><\/td> <td align=\"center\" style=\"font-size: 12px;white-space: nowrap;\">AwardWallet <span class=\"bold\">Plus<\/span><\/td> <\/tr> <\/thead> <tbody> <tr> <td>Suivez automatiquement les soldes de r\u00e9compenses<\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Suivez les r\u00e9compenses pour les membres de votre famille<\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Suivez automatiquement les plans de voyage<\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Permettez le partage des plans ou soldes de r\u00e9compenses<\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Recevez des notifications pour vous avertir de l\u2019expiration des soldes par e-mail et (\u00e9ventuellement) avec des notifications push sur votre t\u00e9l\u00e9phone<br \/> (fr\u00e9quence: 90, 60, 30 et 7 jours avant l\u2019expiration)<\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Acc\u00e9dez \u00e0 toutes vos donn\u00e9es sur un dispositif mobile<\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td><a class=\"blue-link\" href=\"https:\/\/awardwallet.com\/faqs.php#44\">Configurez l\u2019authentification \u00e0 deux facteurs<\/a> sur votre compte<\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Analyse des d\u00e9penses de carte de cr\u00e9dit des transactions quotidiennes pour optimiser les points gagn\u00e9s avec chaque marchand<\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Affichez les propri\u00e9t\u00e9s des comptes de r\u00e9compenses suppl\u00e9mentaires<\/td> <td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Affichez le tableau de l\u2019historique des modifications de solde des comptes<\/td> <td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Affichez les historiques de transactions pour certains de vos comptes de fid\u00e9lit\u00e9<\/td> <td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Autorisez l\u2019exportation des soldes de r\u00e9compenses au format Excel ou PDF<\/td> <td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Mise \u00e0 jour des comptes en parall\u00e8le (jusqu\u2019\u00e0 5 fois plus rapide)<\/td> <td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Nombre de fois que les utilisateurs peuvent mettre \u00e0 jour un compte toutes les 24 heures<\/td> <td align=\"center\">Deux fois<\/td> <td align=\"center\">Illimit\u00e9<\/td> <\/tr> <tr> <td>Affichez la date d\u2019expiration de vos miles ou points<\/td> <td align=\"center\">Jusqu\u2019\u00e0 3 expirations<\/td> <td align=\"center\">Illimit\u00e9<\/td> <\/tr> <tr> <td>Soutenez les efforts de d\u00e9veloppement d\u2019AwardWallet<\/td> <td align=\"center\"><i class=\"icon-error-small\">&nbsp;<\/i><\/td> <td align=\"center\"><i class=\"icon-sucess-small\">&nbsp;<\/i><\/td> <\/tr> <tr> <td>Prix<\/td> <td align=\"center\">GRATUIT<\/td> <td align=\"center\">30 $ pour 1 ann\u00e9e<\/td> <\/tr> <\/tbody><\/table>", "faq", "fr");
t.add("answer.24", "Oui. Aucune de vos donn\u00e9es ne sera supprim\u00e9e, vous serez simplement d\u00e9class\u00e9 avec une option de mise \u00e0 niveau.", "faq", "fr");
t.add("answer.27", "<img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/27-1.png\" style=\"width: 650px; height: 59px;\" \/> <p style=\"line-height:1.5\">1. Indique que le solde a chang\u00e9 au cours des 24 derni\u00e8res heures<br \/> 2. Case \u00e0 cocher pour s\u00e9lectionner ce compte pour d'autres actions<br \/> 3. Montre des d\u00e9tails suppl\u00e9mentaires relatifs au compte<br \/> 4. La connexion automatique est d\u00e9sactiv\u00e9e pour ce compte<br \/> 5.&nbsp;Ic\u00f4ne d'alliance fournisseur<br \/> 6. Progression de niveau \u00e9lite Alliance<br \/> 7. Nom d'utilisateur utilis\u00e9 pour se connecter \u00e0 ce compte<br \/> 8. Num\u00e9ro de compte<br \/> 9. Indique que le mot de passe de ce compte est stock\u00e9 localement dans le navigateur<br \/> 10. Niveau actuel d'\u00e9lite dans le programme<br \/> 11. Progr\u00e8s au niveau d'\u00e9lite<br \/> 12. Solde du compte<br \/> 13. Indique que la mise \u00e0 jour d'arri\u00e8re plan est d\u00e9sactiv\u00e9e pour des raisons techniques<br \/> 14. Montre qu'il s'agit d'une entr\u00e9e personnalis\u00e9e et que le solde n'est pas automatiquement mis \u00e0 jour<br \/> 15. Valeur de modification du dernier solde<br \/> 16. Indique si la derni\u00e8re variation du solde \u00e9tait positive ou n\u00e9gative<br \/> 17. Progr\u00e8s vers votre objectif \u00e9tabli<br \/> 18. Date d'expiration du solde<br \/> 19. Montre que la date d'expiration du solde \u00e9tait calcul\u00e9e<\/p>", "faq", "fr");
t.add("answer.28", "Si vous invitez des utilisateurs et qu'ils rejoignent AwardWallet, vous obtenez des mises \u00e0 niveau gratuites de 6 mois pour toutes les 5 personnes qui nous rejoignent, mais il y a plus encore. Si <a href=\"\/agent\/invites.php\">l'une des personnes que vous invitez<\/a> nous paie pour AwardWallet Plus, vous obtiendrez des points de prime proportionnellement \u00e0 leur contribution. Si les personnes que vous invitez ne nous paient pas pour les mises \u00e0 jour, vous n'obtenez aucun point. Lorsque vous atteignez <a href=\"\/agent\/redeem.php\">certains seuils<\/a>, nous allons convertir ces points en miles de votre choix et d\u00e9poser ces miles ou points sur votre compte de fid\u00e9lit\u00e9. Pour plus de d\u00e9tails, veuillez revoir notre conseil sur ce lien:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/21-awardwallet-referrals\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/21-awardwallet-referrals\/<\/a>", "faq", "fr");
t.add("answer.29", "<a href=\"https:\/\/business.awardwallet.com\/\">L\u2019interface commerciale AwardWallet<\/a> est con\u00e7ue pour nos clients d\u2019affaires, tandis qu\u2019AwardWallet.com est con\u00e7u pour les membres individuels qui suivent des programmes pour eux-m\u00eames et les membres de leur famille. Via l\u2019interface, vous pouvez: <ol class=\"counter-list\"> <li>G\u00e9rer les demandes de r\u00e9servation de r\u00e9compense pour vos utilisateurs (configuration suppl\u00e9mentaire requise pour activer cette fonctionnalit\u00e9).<\/li> <li>Suivre les programmes de fid\u00e9lisation d\u2019entreprise tels que les programmes Alaska Airlines (EasyBiz) ou KLM BlueBiz.<\/li> <li>Avoir beaucoup d\u2019utilisateurs li\u00e9s dans votre profil. Alors que l\u2019interface r\u00e9guli\u00e8re d\u2019Awardwallet.com n\u2019est pas con\u00e7ue pour prendre en charge des centaines voire des milliers de comptes li\u00e9s, l\u2019interface commerciale est con\u00e7ue uniquement dans ce but. Vous pouvez lier un compte d\u2019entreprise avec les voyageurs qui utilisent l\u2019interface r\u00e9guli\u00e8re d\u2019AwardWallet, et ils peuvent choisir quoi partager avec votre compte d\u2019entreprise.&nbsp;Par exemple, les voyageurs peuvent choisir de ne partager que leurs num\u00e9ros de compte de r\u00e9compense, ou bien ils peuvent laisser l\u2019entreprise&nbsp;administrer et surveiller int\u00e9gralement leurs comptes de r\u00e9compenses.<\/li> <li>L\u2019interface commerciale vous permet de suivre les plans de voyage d\u2019utilisateurs individuels.<\/li> <li>L\u2019interface commerciale contient une <a href=\"https:\/\/awardwallet.com\/api\/account\">interface de programmation d\u2019applications qui vous permet de saisir des informations de compte de mani\u00e8re programm\u00e9e<\/a>.&nbsp;<\/li> <\/ol>", "faq", "fr");
t.add("answer.30", "Cette fonctionnalit\u00e9 est uniquement disponible pour les comptes d'entreprise (<a href=\"https:\/\/business.AwardWallet.com\">https:\/\/business.AwardWallet.com<\/a>). Si vous avez un compte d'entreprise AwardWallet Business, vous pouvez programmer vos comptes \u00e0 \u00eatre export\u00e9s comme d\u00e9crit dans notre documentation API :<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/api\/account\">https:\/\/awardwallet.com\/api\/account<\/a>", "faq", "fr");
t.add("answer.31", "<div class=\"flex\" style=\"-webkit-align-items: flex-start;\n    -ms-align-items: flex-start;\n    align-items: flex-start;\"> <div class=\"flex__info\"> <p>AwardWallet OneCard est une carte en plastique de carte de cr\u00e9dit avec bande magn\u00e9tique (qui vous permet de v\u00e9rifier vos vols dans les kiosques de l'a\u00e9roport). La carte aura vos num\u00e9ros de compte personnels et les num\u00e9ros de t\u00e9l\u00e9phone du programme imprim\u00e9s sur les c\u00f4t\u00e9s avant et arri\u00e8re. La carte peut contenir jusqu'\u00e0 30 comptes de programmes de fid\u00e9lit\u00e9 diff\u00e9rents r\u00e9pertori\u00e9s. Nous avons deux types de cartes : or et argent. Les membres de AwardWallet qui ont plus de 1 million de miles et de points obtiendront une carte d'or et ceux qui ont moins de 1 million de miles et les points obtiendront une carte d'argent. Les cartes seront exp\u00e9di\u00e9es \u00e0 l'international aussi bien qu'aux \u00c9tats-Unis, via le service postal des \u00c9tats-Unis.<\/p> <br> <p>OneCard a un co\u00fbt forfaitaire de 10 $, avec livraison gratuite partout dans le monde. &nbsp;Vous trouverez plus de d\u00e9tails <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/30-awardwallet-onecard\/\">ici<\/a>.<\/p> <br> <\/div> <div class=\"flex__image\"><a href=\"#\"><img alt=\"\" src=\"\/images\/uploaded\/fck\/Image\/OneCardSmall.png\" style=\"margin-left: 20px; width: 283px; height: 182px;\" \/><\/a><\/div> <\/div>", "faq", "fr");
t.add("answer.32", "Non, AwardWallet OneCard ne stocke aucun de vos mots de passe, donc, si vous perdez votre carte, vous ne perdrez que vos num\u00e9ros de compte et non les mots de passe.", "faq", "fr");
t.add("answer.33", "Non. AwardWallet est compl\u00e8tement ind\u00e9pendant de tout h\u00f4tel, compagnie a\u00e9rienne ou carte de cr\u00e9dit mentionn\u00e9 ici et tout programmes de fid\u00e9lit\u00e9 suivi ou surveill\u00e9 \u00e0 l'aide de nos services.", "faq", "fr");
