t.add("answer.35", "Un compte d'entreprise peut \u00eatre enregistr\u00e9 \u00e0 partir de z\u00e9ro via:<br \/> <br \/> <a href=\"https:\/\/business.awardwallet.com\/?Register=1\">https:\/\/business.awardwallet.com\/?Register=1<\/a><br \/> <br \/> Ou si vous avez un compte personnel sur AwardWallet, vous pouvez cr\u00e9er un compte professionnel li\u00e9 \u00e0 votre compte personnel, afin de pouvoir utiliser les m\u00eames identifiants pour vous connecter \u00e0 un compte professionnel et \u00e0 votre compte personnel. Pour ce faire, veuillez cliquer sur le lien suivant :<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/user\/create-business-account\">https:\/\/awardwallet.com\/user\/create-business-account<\/a>", "faq", "fr");
t.add("answer.36", "Le prix est de 2,50 $ par mois et pour chaque membre g\u00e9r\u00e9.", "faq", "fr");
t.add("answer.37", "Presque. Tout d'abord, avec la version gratuite, vous pouvez cliquer sur \u00ab Modifier \u00bb pour n'importe quel programme pour voir sa date d\u2019expiration (m\u00eame si elle est dissimul\u00e9e dans la vue de liste). Elle n\u2019est donc qu\u2019\u00e0 un clic. Deuxi\u00e8mement, vous pouvez d\u00e9grouper vos programmes (touche \u00ab Visualisations \u00bb, en haut \u00e0 droite -> \u00ab D\u00e9grouper les comptes (liste forfaitaire) \u00bb), puis les trier par date d\u2019expiration, selon le nom du programme ou le solde dans l'ordre que vous voulez (croissant ou d\u00e9croissant). \u00c9tant donn\u00e9 que nous montrons toujours les 3 premi\u00e8res dates d'expiration en r\u00e9ordonnant vos programmes, vous contr\u00f4lez les dates d'expiration qui sont visibles.", "faq", "fr");
t.add("answer.39", "Tout d'abord, vous devez avoir des droits d'administrateur sur votre ordinateur afin d'installer cette extension, en d'autres termes, vous devriez pouvoir installer d'autres programmes sur votre ordinateur. Si vous avez install\u00e9 l'extension, mais qu'AwardWallet vous indique que l'extension n'est pas install\u00e9e, vous devez v\u00e9rifier deux choses: <ol class=\"counter-list\"> <li>Assurez-vous que l'extension est r\u00e9ellement activ\u00e9e. Voici quelques captures d'\u00e9cran qui peuvent vous aider \u00e0 faire cela:<br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-1.png\" style=\"width: 675px; height: 427px;\" \/><br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-2.png\" style=\"width: 741px; height: 450px;\" \/><\/li> <li>Assurez-vous de compl\u00e8tement red\u00e9marrer Internet Explorer <span class=\"bold\">apr\u00e8s avoir<\/span> activ\u00e9 l'extension. Dans la plupart des cas, la fermeture de toutes les fen\u00eatres du navigateur, mais dans certains cas, un red\u00e9marrage de l'ordinateur est requis.&nbsp;<\/li> <\/ol> <br \/> Si ces \u00e9tapes ne fonctionnent pas, vous pouvez essayer de d\u00e9sinstaller l'extension et l'installer \u00e0 nouveau \u00e0 partir de z\u00e9ro. Voici comment d\u00e9sinstaller l'extension:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-3.png\" style=\"width: 780px; height: 526px;\" \/><br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/39-4.png\" style=\"width: 780px; height: 480px;\" \/>", "faq", "fr");
t.add("answer.40", "<ul> <li>Cliquez sur la petite fl\u00e8che \u00e0 c\u00f4t\u00e9 de la section \u00abAutres calendriers\u00bb et choisissez \u00abAjouter selon URL\u00bb:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/40-1.png\" style=\"width: 737px; height: 401px;\" \/><\/li> <li>Copiez et collez votre lien iCal personnel en cliquant sur le bouton <a href=\"\/trips\/?calendarImport=1\">Importation automatique calendrier<\/a> :<br \/> <br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/40-2.png\" style=\"width: 440px; height: 220px;\" \/><\/li> <li>Si votre calendrier Google n'est pas mis \u00e0 jour avec de nouveaux plans de voyage, veuillez ajouter la cha\u00eene suivante \u00e0 la fin de l'url: \u00ab?nocache\u00bb sans les guillemets, selon <a href=\"https:\/\/productforums.google.com\/forum\/#!topic\/calendar\/ixQnzHmWDSk%5B1-25-false%5D\">ce segment<\/a>.<\/li> <\/ul>", "faq", "fr");
t.add("answer.41", "<ul> <li>Cliquez sur Fichier -> Nouvel abonnement au calendrier:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-1.png\" style=\"width: 618px; height: 378px;\" \/><\/li> <li>Copiez et collez votre lien iCal personnel en cliquant sur le bouton&nbsp;<a href=\"\/trips\/?calendarImport=1\">Importation automatique au calendrier<\/a>&nbsp;:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-2.png\" style=\"width: 604px; height: 151px;\" \/><\/li> <li>Configurez les param\u00e8tres&nbsp;comme vous le souhaitez:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/41-3.png\" style=\"width: 595px; height: 341px;\" \/><\/li> <\/ul>", "faq", "fr");
t.add("answer.42", "<ul> <li>Ouvrez Microsoft Outlook et passez \u00e0 votre Calendrier:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-1.png\" style=\"width: 231px; height: 257px;\" \/><\/li> <li>Dans la barre de menu sup\u00e9rieure cliquez sur \u00abOuvrir Calendrier\u00bb -> \u00ab\u00c0 partir d'Internet\u00bb:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-2.png\" style=\"width: 438px; height: 214px;\" \/><\/li> <li>Copiez et collez votre lien iCal personnel, en cliquant sur le bouton&amp;nbsp;&nbsp;<a href=\"\/trips\/?calendarImport=1\">Importation automatique au calendrier<\/a>&nbsp;:<br \/> <br \/> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/42-3.png\" style=\"width: 455px; height: 153px;\" \/><\/li> <\/ul>", "faq", "fr");
t.add("answer.43", "Voici comment cela fonctionne : <ul> <li>Vous <a href=\"https:\/\/awardwallet.com\/awardBooking\/add\">soumettez une nouvelle demande de r\u00e9servation de r\u00e9compense<\/a> qui est transf\u00e9r\u00e9e \u00e0 notre file d'attente de r\u00e9servation.<\/li> <li>Un membre de l'\u00e9quipe de r\u00e9servations qui travaille avec AwardWallet va vous contacter et travailler avec vous.<\/li> <li>Le co\u00fbt peut osciller entre&nbsp;150 $ et 199 $&nbsp;par personne r\u00e9serv\u00e9e.<\/li> <\/ul> Il convient de mentionner qu'il y a deux \u00e9quipes impliqu\u00e9es : l'\u00e9quipe qui fait les r\u00e9servations r\u00e9elles et celle du support technique d'AwardWallet. L'\u00e9quipe d'AwardWallet vous offre uniquement une plateforme technique \u2013 un moyen de g\u00e9rer vos demandes de r\u00e9servation et de partager en toute s\u00e9curit\u00e9 vos informations de r\u00e9compenses aupr\u00e8s de votre agent. L'\u00e9quipe de r\u00e9servations r\u00e9alisera tout le travail de base : elle recherche la disponibilit\u00e9, ex\u00e9cute diff\u00e9rentes options en votre nom (en communiquant avec vous en permanence avant que les billets soient r\u00e9serv\u00e9s), trouvent les itin\u00e9raires les plus optimaux et les moins chers, font les r\u00e9servations r\u00e9elles, et traitent les paiements. Ce sont des experts dans la r\u00e9servation des r\u00e9compenses. Ils ont fait des dizaines de milliers de r\u00e9servations pour leurs clients et sont tr\u00e8s cr\u00e9atifs pour trouver de la disponibilit\u00e9. Toute la communication concernant une demande de r\u00e9servation se fait via le site Web d'AwardWallet, o\u00f9 vous pouvez g\u00e9rer vos demandes et communiquer avec votre agent de r\u00e9servation. Donc, si vous avez une question relative \u00e0 une demande de r\u00e9servation, ne l'envoyez pas au d\u00e9partement de support d'AwardWallet, car nous ne pourrions pas vous aider, vous devez vous connecter \u00e0 votre compte et r\u00e9pondre \u00e0 <a href=\"https:\/\/awardwallet.com\/awardBooking\/requests?archive=1\">votre demande de r\u00e9servation existante<\/a>&nbsp;ou cr\u00e9er une nouvelle demande de r\u00e9servation :<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/awardBooking\/add\">https:\/\/awardwallet.com\/awardBooking\/add<\/a><br \/> <br \/> Pour plus de d\u00e9tails, veuillez jeter un coup d\u2019oeil \u00e0 ce conseil :<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/23-award-booking-service\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/23-award-booking-service\/<\/a>", "faq", "fr");
t.add("answer.44", "Oui, vous pouvez activer l'authentification \u00e0 deux facteurs dans votre profil, rendant votre profil AwardWallet beaucoup plus s\u00e9curis\u00e9. \u00c0 un niveau \u00e9lev\u00e9, cela signifie que vous utiliserez votre t\u00e9l\u00e9phone pour g\u00e9n\u00e9rer un code unique, en plus de votre nom d'utilisateur et mot de passe, pour vous connecter \u00e0 AwardWallet. &nbsp;Si vous ne connaissez pas l'authentification \u00e0 deux facteurs, vous pour lire <a href=\"https:\/\/en.wikipedia.org\/wiki\/Two-factor_authentication\">l'article Wiki<\/a> suivant, ou simplement r\u00e9aliser une recherche avec <a href=\"https:\/\/www.google.com\/webhp?&amp;q=what+is+two+factor+authentication\">Google<\/a>.&nbsp;<br \/> <br \/> La configuration de l'authentification \u00e0 deux facteurs est tr\u00e8s simple; tout d'abord, vous devez t\u00e9l\u00e9charger une application Google Authenticator pour votre dispositif <a href=\"https:\/\/play.google.com\/store\/apps\/details?id=com.google.android.apps.authenticator2&amp;hl=en\">Android<\/a>, <a href=\"https:\/\/itunes.apple.com\/us\/app\/google-authenticator\/id388497605?mt=8\">iOS<\/a> or <a href=\"http:\/\/www.windowsphone.com\/en-US\/apps\/021dd79f-0598-e011-986b-78e7d1fa76f8\">Windows Phone<\/a>. Puis, vous devez cliquer sur \u00ab<a href=\"https:\/\/awardwallet.com\/user\/edit.php\">Configuration<\/a> \u00bb sous la rubrique Authentification \u00e0 deux facteurs dans votre <a href=\"https:\/\/awardwallet.com\/user\/edit.php\">profil AwardWallet<\/a>. Ensuite, vous verrez un code QR sp\u00e9cial qui doit \u00eatre analys\u00e9 par l'application Google Authenticator pour le configurer:<br \/> &nbsp; <div class=\"t-center\"><img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/44.png\" style=\"width: 650px; height: 700px;\" \/><\/div> <br \/> <br \/> Ensuite, vous entrez le code g\u00e9n\u00e9r\u00e9 par l'application dans AwardWallet et vous avez termin\u00e9. Pour plus de d\u00e9tails, jetez un coup d'oeil sur ce conseil:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/26-two-factor-authentication\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/26-two-factor-authentication\/<\/a>", "faq", "fr");
t.add("answer.5", "Non. AwardWallet ne peut pas vous inscrire dans un programme de r\u00e9compense, ni ajouter des miles ou des points \u00e0 vos programmes de r\u00e9compense. AwardWallet peut vous aider \u00e0 r\u00e9aliser un suivi de vos soldes de programme de r\u00e9compense en se connectant, en vote nom, aux sites web qui contiennent vos informations de solde. Nous ne pouvons pas ajouter de miles \u00e0 votre programme, seul le titulaire du programme de r\u00e9compense peut le faire. Vous devrez contacter la compagnie a\u00e9rienne que vous avez utilis\u00e9e pour voyager et leur demander d'ajouter les miles \u00e0 votre compte. Ensuite, utilisez AwardWallet pour r\u00e9aliser un suivi de vos soldes. AwardWallet est particuli\u00e8rement utile si vous participez \u00e0 plusieurs programmes de r\u00e9compense avec diff\u00e9rentes compagnies a\u00e9riennes, h\u00f4tels, etc.", "faq", "fr");
t.add("answer.8", "Non. AwardWallet est con\u00e7u pour suivre vos soldes de programmes de r\u00e9compense en se connectant, en votre nom, aux sites web qui contiennent vos informations de solde. Nous ne sommes pas affili\u00e9s aux sites web (ex: hilton.com, jetblue.com, etc.) d'aucune mani\u00e8re qui soit, vous devrez donc r\u00e9soudre tous les probl\u00e8mes connexes directement avec le fournisseur du programme de r\u00e9compense. Par exemple, si vous ne savez pas comment vous connecter au site web de &nbsp;hilton.com pour v\u00e9rifier votre solde Hilton Honors, vous devrez vous rendre \u00e0 hilton.com et r\u00e9soudre ce probl\u00e8me directement avec eux, avant de pouvoir utiliser AwardWallet.", "faq", "fr");
t.add("answer.9", "<div class=\"_counter-wrap\"> <span class=\"_green-blk\">1<\/span> La cause principale de cette erreur est l'identification non valide. Avant qu'AwardWallet ne puisse r\u00e9cup\u00e9rer vos informations de solde, vous devez vous assurer de pouvoir vous connecter au site Web du fournisseur et voir votre solde. Voici comment vous pouvez v\u00e9rifier que vous saisissez des identifiants valides: <\/div> <div class=\"_counter-wrap\"> <span class=\"_gray-blk\">a<\/span> <div>Acc\u00e9dez \u00e0 AwardWallet et cliquez sur le lien \u00abModifier\u00bb par le programme en question.<\/div> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-1.png\" style=\"width: 400px; height: 78px;\" \/> <\/div> <div class=\"_counter-wrap\"> <span class=\"_gray-blk\">b<\/span> <div>Ensuite, cliquez sur \u00abR\u00e9v\u00e9ler le mot de passe\u00bb juste en-dessous de votre champ de mot de passe.<\/div><img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-2.png\" style=\"width: 396px; height: 72px;\" \/> <\/div> <div class=\"_counter-wrap\"> <span class=\"_gray-blk\">c<\/span> <div>\u00c0 ce stade, vous serez invit\u00e9 \u00e0 recevoir votre mot de passe principal AwardWallet. Saisissez-le et cliquez sur \"R\u00e9v\u00e9ler\". &nbsp;Apr\u00e8s cela, vous devriez voir votre nom d'utilisateur et votre mot de passe en texte clair.<\/div> <img alt=\"\" src=\"\/images\/uploaded\/fck\/faq\/%locale%\/09-3.png\" style=\"width: 400px; height: 238px;\" \/> <\/div> <div class=\"_counter-wrap\"> <span class=\"_gray-blk\">d<\/span> <div>Copiez votre nom d'utilisateur et mot de passe, puis collez &nbsp;(ne ressaisissez pas tout simplement)&nbsp; les&nbsp;dans les cases de donn\u00e9es de connexion sur le site web du fournisseur en question.<\/div> <\/div> <div class=\"_counter-wrap\"><span class=\"_green-blk\">2<\/span> Si le site Web du fournisseur vous pose des questions sur votre profil apr\u00e8s votre connexion, AwardWallet ne pourra pas v\u00e9rifier votre solde, jusqu'\u00e0 ce que vous y r\u00e9pondiez. <\/div> <div class=\"_counter-wrap\"> <span class=\"_green-blk\">3<\/span> Si vous choisissez d'enregistrer vos mots de passe localement, il est possible que vous ayez supprim\u00e9 des cookies ou modifi\u00e9 votre ordinateur. <\/div> <div class=\"_counter-wrap\"> <span class=\"_green-blk\">4<\/span> Il est \u00e9galement possible que le site Web du fournisseur ait chang\u00e9 et qu'AwardWallet n'en soit pas au courant. Si aucun de ces cas n'est vrai, veuillez nous <a class=\"a14pxBlue blue-link\" href=\"\/contact.php\">envoyer une note<\/a> et nous ferons de notre mieux pour r\u00e9soudre le probl\u00e8me. <\/div>", "faq", "fr");
