t.add("answer.72", "Malheureusement, pour le moment, AwardWallet n\u2019offre pas d\u2019assistance t\u00e9l\u00e9phonique. Il n\u2019y a donc aucun num\u00e9ro que vous puissiez appeler pour nous parler, mais vous pouvez poser toutes vos questions via notre page <a href=\"https:\/\/awardwallet.com\/contact\">Contactez-nous<\/a> et un de nos repr\u00e9sentants de support sera en contact. Nous r\u00e9pondons g\u00e9n\u00e9ralement aux demandes d\u2019assistance dans un d\u00e9lai d\u2019un jour ouvrable.", "faq", "fr");
t.add("question.72", "J\u2019ai une question concernant mon profil AwardWallet, quel est votre num\u00e9ro de t\u00e9l\u00e9phone d\u2019assistance technique?", "faq", "fr");
t.add("answer.45", "Dans l\u2019interface Web, une fois le chargement de votre page de compte termin\u00e9, il vous suffit de commencer \u00e0 saisir le nom du compte que vous souhaitez voir, et il s\u2019affichera. Voir le conseil suivante pour plus de d\u00e9tails:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/1-filter-accounts\/<\/a>", "faq", "fr");
t.add("question.45", "J\u2019ai trop de comptes dans mon profil, comment puis-je trouver rapidement des comptes sp\u00e9cifiques?", "faq", "fr");
t.add("answer.46", "Si la compagnie a\u00e9rienne en question fait partie d\u2019une alliance, une ic\u00f4ne d\u2019alliance appara\u00eet \u00e0 c\u00f4t\u00e9. Cliquez sur l\u2019ic\u00f4ne pour voir toutes les compagnies a\u00e9riennes faisant partie de cette alliance. Pour plus de d\u00e9tails, veuillez revoir notre conseil sur ce lien:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/2-airline-alliance-popup\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/2-airline-alliance-popup\/<\/a>", "faq", "fr");
t.add("question.46", "Comment savoir si je peux utiliser mes miles pour voyager avec une autre compagnie a\u00e9rienne?", "faq", "fr");
t.add("answer.47", "Si vous avez un moniteur de grande taille, l\u2019agrandissement de la largeur de votre navigateur ajoutera automatiquement une colonne \u00abDerni\u00e8re mise \u00e0 jour\u00bb \u00e0 votre liste de compte. Pour plus de d\u00e9tails, veuillez revoir notre conseil sur ce lien:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/3-last-updated-column\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/3-last-updated-column\/<\/a>", "faq", "fr");
t.add("answer.48", "Commencez par mettre \u00e0 jour vos comptes, puis cliquez sur le signe + en regard du programme et passez \u00e0 l\u2019onglet \u00abHistorique\u00bb. Tous les d\u00e9tails de la derni\u00e8re transaction appara\u00eetront ici. Pour plus de d\u00e9tails, veuillez revoir notre conseil sur ce lien:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/4-individual-transaction-history\/<\/a>", "faq", "fr");
t.add("answer.52", "Oui, ajoutez simplement <a href=\"https:\/\/awardwallet.com\/agents\/add\">les noms des membres de votre famille \u00e0 votre profil<\/a>, et vous pourrez ensuite attribuer des comptes de fid\u00e9lit\u00e9 \u00e0 des noms de membres de famille individuels. Pour plus de d\u00e9tails, veuillez revoir notre conseil sur ce lien:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/8-track-accounts-for-family\/<\/a>", "faq", "fr");
t.add("answer.53", "Oui, vous pouvez (et devriez) enregistrer vos mots de passe&nbsp;si vous&nbsp;avez d\u00e9cid\u00e9 de les stocker localement. Vous pouvez le faire en s\u00e9lectionnant les comptes que vous souhaitez enregistrer, puis choisissez l\u2019option \u00abMots de passe de sauvegarde\u00bb \u00e0 partir du menu \u00abActions\u00bb. &nbsp;Pour plus de d\u00e9tails, veuillez revoir notre conseil sur ce lien: <br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/9-backup-your-passwords\/<\/a>", "faq", "fr");
t.add("answer.56", "Oui, vous pouvez <a href=\"https:\/\/awardwallet.com\/agents\/add-connection\">associer vos comptes<\/a>, puis choisir les comptes que vous souhaitez partager les uns avec les autres et quel niveau d\u2019acc\u00e8s souhaitez-vous fournir. Pour plus de d\u00e9tails, veuillez revoir notre conseil sur ce lien: <br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/12-sharing-account-information\/<\/a>", "faq", "fr");
t.add("answer.68", "Tout d'abord, merci! Ensuite, oui, nous <a href=\"\/faqs#28\">avon un programme d\u2019affiliation<\/a>, et tous nos logos et captures d\u2019\u00e9cran et banni\u00e8res sont toujours parfaitement organis\u00e9s sur <a href=\"https:\/\/awardwallet.com\/media\/logos\">cette page<\/a> qui d'ailleur, peut toujours \u00eatre accessible si vous cliquez avec le bouton droit de la souris (option-clic) sur notre logo en haut de chaque page. Pour plus de d\u00e9tails, veuillez revoir notre conseil sur ce lien:<br \/> <br \/> <a href=\"https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/\">https:\/\/awardwallet.com\/blog\/tip_of_the_day\/27-logos-and-banners\/<\/a>", "faq", "fr");
t.add("answer.70", "Pour supprimer l\u2019un des comptes de fid\u00e9lit\u00e9 de votre profil AwardWallet, vous devez d\u2019abord&nbsp;s\u00e9lectionner ce compte en cochant une case \u00e0 c\u00f4t\u00e9 de celle-ci, puis un bouton avec une corbeille dans le menu permettra de supprimer tous les boutons. comptes s\u00e9lectionn\u00e9s.<br \/> <br \/> <img alt=\"\" src=\"https:\/\/awardwallet.com\/images\/uploaded\/fck\/faq\/en\/70-1.png\" style=\"width: 650px; height: 383px;\" \/>", "faq", "fr");
t.add("answer.71", "Commencez par v\u00e9rifier que vous avez entr\u00e9 le bon code. Si vous \u00eates s\u00fbr \u00e0 100% que le code est correct, il pourrait s\u2019agir d\u2019un probl\u00e8me de synchronisation temporelle. Si l\u2019heure de votre ordinateur portable est 13&nbsp;heures et l'heure sur votre t\u00e9l\u00e9phone o\u00f9 vous g\u00e9n\u00e9rez le code est 13:03 heures, cela indique un probl\u00e8me. Dans ce cas, vous devez <a href=\"https:\/\/www.google.com\/search?q=how+to+sync+clock+on+android\">synchroniser l\u2019horloge de votre&nbsp;t\u00e9l\u00e9phone<\/a> et r\u00e9essayez.", "faq", "fr");
