t.add("answer.74", "Balance Watch surveille un compte de fid\u00e9lit\u00e9 pour vous alerter d\u00e8s que votre solde change. Les points d\u2019American Express, Chase, Citi, Marriott et Capital One ne s\u2019affichent pas toujours instantan\u00e9ment lorsque vous les transf\u00e9rez vers des programmes de fid\u00e9lit\u00e9 partenaires.&nbsp;<br \/> <br \/> Lorsque vous trouvez la disponibilit\u00e9 des primes pour un vol ou un h\u00f4tel, transf\u00e9rez vos points, puis utilisez ce service pour vous assurer de pouvoir confirmer votre r\u00e9servation avant que la disponibilit\u00e9 ne disparaisse. Une fois activ\u00e9, AwardWallet v\u00e9rifiera votre compte fr\u00e9quemment et vous enverra une notification par e-mail, mobile et sur votre ordinateur de bureau d\u00e8s qu\u2019un changement sera d\u00e9tect\u00e9.&nbsp;<br \/> <br \/> Voici une courte vid\u00e9o explicative enregistr\u00e9e par nos amis de TripAstute :<br \/> &nbsp; <div style=\"max-width:640px; width: 100%\"> <div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/329111256\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div> <\/div>", "faq", "fr");
t.add("question.74", "Quels sont les cr\u00e9dits Balance Watch?", "faq", "fr");
t.add("answer.75", "Le <a href=\"https:\/\/awardwallet.com\/merchants\">Merchant Lookup Tool<\/a> d\u2019AwardWallet permet aux utilisateurs de rechercher des merchants et d\u2019identifier comment les transactions avec ces merchants sont cod\u00e9es pour une transaction de carte de cr\u00e9dit. C\u2019est important pour optimiser le nombre de points que vous pouvez gagner avec une carte de cr\u00e9dit sp\u00e9cifique.<br \/> <br \/> Certaines cat\u00e9gories de bonus les plus courantes pour les d\u00e9penses par carte de cr\u00e9dit sont les courses alimentaires, le carburant, les voyages et les restaurants. Cependant, tous les types de merchants ne sont pas toujours faciles \u00e0 classer. Pour le savoir, faites une simple recherche du commerce en question dans le Merchant Lookup Tool et il&nbsp; s\u2019affichera une liste des cartes de cr\u00e9dit confirm\u00e9es qui font gagner plus de 1 point par dollar chez ce merchant en particulier. <br \/> <br \/> Voici une petite vid\u00e9o d\u2019explication : <br \/> <div style=\"max-width:640px; width: 100%\"> <div style=\"position: relative; padding-bottom: 56.25%\"><iframe allowfullscreen=\"\" frameborder=\"0\" mozallowfullscreen=\"\" src=\"https:\/\/player.vimeo.com\/video\/360577226\" style=\"width: 100%; height: 100%; position: absolute; top:0; left: 0\" webkitallowfullscreen=\"\"><\/iframe><\/div> <\/div>", "faq", "fr");
t.add("question.75", "Qu\u2019est-ce que le Merchant Lookup Tool d\u2019AwardWallet ?", "faq", "fr");
t.add("answer.76", "AwardWallet only uses your Gmail data to retrieve travel reservations and loyalty account statements for the purposes of making the AwardWallet&#39;s service work. AwardWallet&#39;s use of information received, and AwardWallet&#39;s transfer of information to any other app, from Google APIs will adhere to Google&#39;s Limited Use Requirements. In addition to that none of your personal data that you have stored in AwardWallet is ever transmitted to any third party without your prior explicit written consent.", "faq", "fr");
